import React, { Component } from 'react'

export default class Todo extends Component {
    render() {
        return (
            <div className={"Todo"}>
                <div className="box">
                    <div className="left">
                        <h1>Truo</h1>
                        <input type="checkbox" value="yes" id="salom" />
                        <label for="sa">
                        </label>
                    </div>
                    <div className="right">
                        <h1>False</h1>
                    </div>
                </div>


            </div>
        )
    }
}
